  {comment_id: "5311599", shot_id: 37, comment_created_at: "2016-05-31T08:26:35Z", body: "<p>Nice transitions and good animation</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/25514/avatars/normal/070810be04e642201206c8fbdffcbf8a.png?1455536235", user_id: "25514", user_name: "Ramotion", localcommentimage_file_name: "data", localcommentimage_content_type: "image/png", localcommentimage_file_size: 3084, localcommentimage_updated_at: "2016-05-31 09:24:17"},
  {comment_id: "5310723", shot_id: 38, comment_created_at: "2016-05-30T22:01:36Z", body: "<p>Well presented, but the idea has the same level of utility as a piano with keys that light up - it might be good for beginners, but virtually useless for anyone experienced. Here it's further complicated by the fact that you still need to somehow show what each shortcut actually does.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/4033/avatars/original/rocket-64x64.png?1311751278", user_id: "4033", user_name: "Alex Pankratov", localcommentimage_file_name: "data", localcommentimage_content_type: "image/png", localcommentimage_file_size: 7167, localcommentimage_updated_at: "2016-05-31 09:58:22"},
  {comment_id: "5311131", shot_id: 38, comment_created_at: "2016-05-31T05:19:41Z", body: "<p>Such nice concept <a href=\"https://dribbble.com/40375\">@Flyphant</a> </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/1040771/avatars/normal/dd967f8f5d8cbbfb33cb99a20f4aea58.jpg?1451597457", user_id: "1040771", user_name: "Darshan Gajara", localcommentimage_file_name: "open-uri20160531-51742-stwfp5", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 33293, localcommentimage_updated_at: "2016-05-31 09:58:22"},
  {comment_id: "5311318", shot_id: 38, comment_created_at: "2016-05-31T06:33:36Z", body: "<p>Smart concept.\n<br />What happens in a well lit area? The problem with backlight is that, it's an accessory to the functional keyboard, and cannot be completely used to denote something. It'll get lost. </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/324062/avatars/normal/db984020f0628ee20b8a7f342690f5c0.jpg?1409862885", user_id: "324062", user_name: "Suganth", localcommentimage_file_name: "open-uri20160531-51742-lko8iu", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 27362, localcommentimage_updated_at: "2016-05-31 09:58:23"},
  {comment_id: "5311463", shot_id: 38, comment_created_at: "2016-05-31T07:43:01Z", body: "<p>Cool</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/24846/avatars/normal/8c77cf35896aa5c70e8f01e69b8f5dd8.jpg?1405490147", user_id: "24846", user_name: "harwen", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 5017, localcommentimage_updated_at: "2016-05-31 09:58:23"},
  {comment_id: "5311484", shot_id: 38, comment_created_at: "2016-05-31T07:50:57Z", body: "<p>@Flyphant Nice idea, wouldnt it be good to show the right symbol in each button if you hold cmd / shift?</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/238310/avatars/normal/david.png?1399839547", user_id: "238310", user_name: "David Huynh", localcommentimage_file_name: "open-uri20160531-51742-184tr86", localcommentimage_content_type: "image/png", localcommentimage_file_size: 27199, localcommentimage_updated_at: "2016-05-31 09:58:23"},
  {comment_id: "5311535", shot_id: 38, comment_created_at: "2016-05-31T08:09:27Z", body: "<p>really nice idea</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/68065/avatars/normal/038ea4afb95ff2a39b4e5fb398d27e37.jpg?1454359432", user_id: "68065", user_name: "Beasty", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 6854, localcommentimage_updated_at: "2016-05-31 09:58:24"},
  {comment_id: "5311809", shot_id: 38, comment_created_at: "2016-05-31T09:13:35Z", body: "<p>Nice idea. I could use something like this! Apple and Microsoft are really well placed to take advantage of this kind of pro feature. A while ago this keyboard with a somewhat similar idea was floating around &gt; <a href=\"https://www.wikiwand.com/en/Optimus_Maximus_keyboard\" rel=\"noreferrer\">https://www.wikiwand.com/en/Optimus_Maximus_keyboard</a>\n<br />Never got off the ground though.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/150542/avatars/normal/72886c234d985c0df80ae24cf77ee66c.jpg?1448646646", user_id: "150542", user_name: "Chris", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 5980, localcommentimage_updated_at: "2016-05-31 09:58:24"},
