  {comment_id: "5313646", shot_id: 61, comment_created_at: "2016-05-31T19:39:38Z", body: "<p>nice construction, how did you learn to do this</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/819249/avatars/normal/49d3323f2cdc19ec7636f9b9d47030f5.png?1447390787", user_id: "819249", user_name: "Mario Ronci", localcommentimage_file_name: "data", localcommentimage_content_type: "image/png", localcommentimage_file_size: 4014, localcommentimage_updated_at: "2016-06-01 00:27:01"},
  {comment_id: "5313649", shot_id: 61, comment_created_at: "2016-05-31T19:40:34Z", body: "<p>With the risk of breaking the geometry here, a mane would do the job on defining the horse better. So nice though, so fucking nice!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/699278/avatars/normal/7bfd7d1dd5674c19611a4c18d14d6a2f.jpg?1454654151", user_id: "699278", user_name: "Daniel Belu", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 9091, localcommentimage_updated_at: "2016-06-01 00:27:01"},
  {comment_id: "5313701", shot_id: 61, comment_created_at: "2016-05-31T20:01:17Z", body: "<p>Very nice job mate <a href=\"https://dribbble.com/67172\">@Julius Seni≈´nas</a> !</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/5976/avatars/original/av-b-at.jpg?1341240896", user_id: "5976", user_name: "Alex Tass", localcommentimage_file_name: "open-uri20160531-2564-1dln59p", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 16916, localcommentimage_updated_at: "2016-06-01 00:27:01"},
  {comment_id: "5313702", shot_id: 61, comment_created_at: "2016-05-31T20:01:39Z", body: "<p><a href=\"https://dribbble.com/699278\">@Daniel Belu</a> agreed ‚Äîwithout the mane, the shape of the head and neck isn't obviously not a cat, dog, ect.</p>\n\n<p>I don't think it's hurting anything from the standpoint of the geometry either because the magic of the negative space is happening on the inside of the neck and chin</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/39609/avatars/normal/d6e51265403f3fcc8906001b8dd0a43f.jpg?1413259546", user_id: "39609", user_name: "Dan Lehman", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 588, localcommentimage_updated_at: "2016-06-01 00:27:01"},
