  {comment_id: "5314809", shot_id: 71, comment_created_at: "2016-06-01T07:26:08Z", body: "<p>Thanks <a href=\"https://dribbble.com/803186\">@Sumender</a> </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/958948/avatars/normal/2af28db39a57562d7bb0fa280328dd02.jpg?1452440099", user_id: "958948", user_name: "Vishikh", localcommentimage_file_name: "open-uri20160601-34474-11axhvs", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 25665, localcommentimage_updated_at: "2016-06-01 08:38:39"},
  {comment_id: "5313919", shot_id: 72, comment_created_at: "2016-05-31T21:36:40Z", body: "<p>wow!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/454156/avatars/normal/b59505c5a38cc5551445e5368731dde0.jpg?1449412310", user_id: "454156", user_name: "Arsen Kolyba", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 7912, localcommentimage_updated_at: "2016-06-01 08:39:27"},
  {comment_id: "5318825", shot_id: 96, comment_created_at: "2016-06-02T11:39:33Z", body: "<p>sweet</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/24612/avatars/normal/e9af572ad9a061eb71562c5801cd4118.png?1460529786", user_id: "24612", user_name: "Nashatwork", localcommentimage_file_name: "data", localcommentimage_content_type: "image/png", localcommentimage_file_size: 8983, localcommentimage_updated_at: "2016-06-02 12:21:16"},
  {comment_id: "5314841", shot_id: 67, comment_created_at: "2016-06-01T07:40:38Z", body: "<p>You have a really amazing case here (y)\n<br />I think right is better, because of some reasons:</p>\n\n<p>- Human eyes tend to be more comfortable with straight direction from left to right.\n<br />- The interaction left -&gt; right is pretty suitable with the \"walking man\" icon (he's walking from left), which is more intuitive.\n<br />- A straight move is easier for gesture and brain.\n<br />- Straight line version makes more room for the button beneath (which is bigger-better for old persons).</p>\n\n<p>I really don't get any clear idea of selecting the circle one. I'm afraid putting the button inside the circle will make the behaviors too complex for targeted users. Not to mention you'll have to rearrange the text (Min / Medium / Good) not to conflict with the button itself.</p>\n\n<p>One thing, you should take care about how the finger may overlap important text (the time number indication) while moving.</p>\n\n<p>About the Play / Pause buttons. I'd like to merge them, because it's easier to remember where to tap, just make color of Start and Pause different to remind the state.</p>\n\n<p>Keep up your fabulous jobs!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/219515/avatars/normal/avatar-blended.png?1399996162", user_id: "219515", user_name: "Miso", localcommentimage_file_name: "open-uri20160601-31419-tthgdl", localcommentimage_content_type: "image/png", localcommentimage_file_size: 46830, localcommentimage_updated_at: "2016-06-01 07:52:38"},
  {comment_id: "5314016", shot_id: 68, comment_created_at: "2016-05-31T22:57:21Z", body: "<p>Really clean! I find the way that the total price transition to be a little too sharp. A tick-up/down type of animation I think would be more delightful. \n<br />Having said that, it's a teeny tiny change that would probably require more work than is necessary. \n<br />Overall, I think the toggle is a great idea and well executed!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/20025/avatars/normal/5a988828b176bcf5ea73b005c8d5a3c5.jpg?1463595241", user_id: "20025", user_name: "Imran Ashraf", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 3820, localcommentimage_updated_at: "2016-06-01 07:58:58"},
