  {title: "Environmental Preservation Landing Page Concept", description: "<p>This is an in-progress project for an non-profit organization. It‚Äôs a one page site that is aimed to help people understand how important trees are to our well-being before it‚Äôs too late. (PLEASE WATCH THE WHOLE ANIMATION TO SEE THE FULL INTERACTION IDEA)</p>\n\n<p>In HCMC where I live, there‚Äôs an ridiculous on-going issue enforcing trees in a certain urban areas to be cut down. I hope that our work could contribute something in saving green around the world. </p>\n\n<p>This shot is just a draft compact version in order to demonstrate the idea, the actual content would be much longer.</p>", width: "400", height: "300", tags: "[\"animation\", \"environment\", \"hcmc\", \"interaction\", \"landing page\", \"motion\", \"parallax\", \"trees\", \"ui\", \"vietnam\", \"web design\"]", image_url: nil, image_path: nil, user_id: 1, viewcount: 4911, likes_count: 595, comments_count: 43, attachments_count: 0, rebounds_count: 0, buckets_count: 69, dribbble_id: 2745365, html_url: "https://dribbble.com/shots/2745365-Environmental-Preservation-Landing-Page-Concept", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2745365/buckets", comments_url: "https://api.dribbble.com/v1/shots/2745365/comments", likes_url: "https://api.dribbble.com/v1/shots/2745365/likes", projects_url: "https://api.dribbble.com/v1/shots/2745365/projects", animated: true, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_url: nil, following_url: nil, shots_url: nil, teams_url: nil, team: nil, images_hidpi: nil, images_normal: "https://d13yacurqjgara.cloudfront.net/users/824641/screenshots/2745365/savet