  {title: "Calendar + Requests for Layouts", description: "<p>I‚Äôve started working on update for my <strong><a href=\"http://janlosert.com/store/dashboard-ui-kit\" rel=\"nofollow noreferrer\">Dashboard UI Kit</a></strong>, which I would like to release in 3 weeks time. In previous shot I gave you opportunity to request any layout you would like to have in this update. </p>\n\n<p><strong>So far I received 3 requests for: </strong>\n<br />- More complete Dropdown UI Kit\n<br />- User Account dropdown from Top Bar\n<br />- Different view of Calendar for Scheduling for the day</p>\n\n<p>I would like to release update with 12 screens so feel free shot me an email at <a href=\"mailto:me@janlosert.com\" rel=\"noreferrer\">me@janlosert.com</a> with your design needs for you next projects.</p>\n\n<p>‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî</p>\n\n<p>Check full preview and whole overview of this huge UI Kit for creating Dashboards. Finally customized for Sketch and Photoshop - <a href=\"http://janlosert.com/store/dashboard-ui-kit\" rel=\"noreferrer\">http://janlosert.com/store/dashboard-ui-kit</a></p>\n\n<p>Get full package of 60 Screens + Styleguides here: \n<br /><strong>Gumroad</strong>: <a href=\"https://gumroad.com/products/Zbogg\" rel=\"noreferrer\">https://gumroad.com/products/Zbogg</a> <strong>(Use \"makeitcheaper\" code to get 33% off!)</strong></p>\n\n<p>Or grab it on <strong><a href=\"https://ui8.net/products/dashboard60-ui-kit\" rel=\"nofollow noreferrer\">UI8</a></strong> \n<br />or <strong><a href=\"https://creativemarket.com/janlosert/598986-Dashboard60-UI-Kit\" rel=\"nofollow noreferrer\">CreativeMarket</a></strong> </p>", width: "400", height: "300", tags: "[\"calendar\", \"dashboard\", \"event\", \"graph\", \"menu\", \"overview\", \"post\", \"profile\", \"schedule\", \"ui\", \"ui kit\", \"web\"]", image_url: nil, image_path: nil, user_id: 40, viewcount: 1290, likes_count: 99, comments_count: 4, attachments_count: 0, rebounds_count: 0, buckets_count: 8, dribbble_id: 2746920, htm