  {title: "Stitch Data", description: "<p>My main man @William Kesling worked up this magic for an awesome data crew in the northeast. The mark plays off the name, as well as, the process of collecting, analyzing, and streamlining data. We also got a really nice subtle \"S\" in the negative space as well. We're super stoked to show more!</p>\n\n<p>_</p>\n\n<p>Looking for a design partner? We would love to hear about your needs. Email us <a href=\"mailto:hello@focuslabllc.com\" rel=\"nofollow noreferrer\"><a href=\"mailto:hello@focuslabllc.com\" rel=\"noreferrer\">hello@focuslabllc.com</a></a></p>\n\n<p><a href=\"http://focuslabllc.com/\" rel=\"nofollow noreferrer\">Our website</a> / <a href=\"https://www.instagram.com/focuslabllc/\" rel=\"nofollow noreferrer\">Instagram</a> / <a href=\"https://twitter.com/focuslabllc\" rel=\"nofollow noreferrer\">Twitter</a>\n</p>", width: "400", height: "300", tags: "[\"animation\", \"black\", \"branding\", \"data\", \"focus lab\", \"mark\", \"motion\", \"s\", \"spool\", \"stitch\", \"yellow\"]", image_url: nil, image_path: nil, user_id: 53, viewcount: 1608, likes_count: 131, comments_count: 5, attachments_count: 0, rebounds_count: 0, buckets_count: 9, dribbble_id: 2747842, html_url: "https://dribbble.com/shots/2747842-Stitch-Data", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2747842/buckets", comments_url: "https://api.dribbble.com/v1/shots/2747842/comments", likes_url: "https://api.dribbble.com/v1/shots/2747842/likes", projects_url: "https://api.dribbble.com/v1/shots/2747842/projects", animated: true, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_url: nil, following_url: nil, shots_url: nil, 