  {title: "Messenger Bots & Partial payment Concept", description: "<p>I thought of how it could be easier to call and interact with bots, when there are lots of them for different purposes like shopping, finance, transportation, reservation etc..</p>\n\n<p>Now on Messenger, you tap on the ‚ÄúMore‚Äù icon to select the app you need, which is difficult -open another screen and browse through all apps- or the related button (like transportation icon for Uber) is on the keyboard bar, but if they are a lot they can‚Äôt fit there.</p>\n\n<p>Besides, you may not know all apps which does the task you need. If they would be associated and directed to user by Messenger, it could serve also to apps for being explored.\n<br /> \n<br />Instead of a button like gif/transportation icons on Messenger keyboard, a symbol on keyboard can be universally used on any chat interface for calling bots about the desired task\n<br />(like hashtag or dollar sign for payment)\n<br />I tried with = symbol , if you begin with = and type what you want to do, Messenger gives suggestions by autocompleting.</p>\n\n<p>Each task can have its specific ui elements, blending command line and GUI. In flight search case for example, a calendar and and passenger selection part can provide easier and quicker input than typing.</p>\n\n<p>Another suggestion is Partial Payment, so that you can split the total amount between users in chat group.</p>", width: "400", height: "300", tags: "[\"ai\", \"bot\", \"chat\", \"facebook\", \"interaction\", \"messenger\", \"principle\", \"ui\", \"ux\", \"widget\"]", image_url: nil, image_path: nil, user_id: 76, viewcount: 759, likes_count: 99, comments_count: 13, attachments_count: 1, rebounds_count: 0, buckets_count: 17, dribbble_id: 2749390, html_url: "https://dribbble.com/shots/2749390-Messenger-Bots-Partial-payment-Concept", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2749390/buckets", comments_url: "https://api.dribbble.com/v1/shots/2749390/comments", likes_url: "https://api.dribbble.com/v1/shots/2749390/likes", projects_url: "https://api.dribbble.com/v1/shots/2749390/projects", animated: true, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_url: nil, following_url: nil, shots_url: nil, teams_url: nil, team: nil, images_hidpi: "https://d13yacurqjgara.cloudfront.net/users/347241/screenshots/2749390/messenger-concept.gif", images_normal: "https://d13yacurqjgara.cloudfront.net/users/347241/screenshots/2749390/messenger-concept_1x.gif", images_teaser: "https://d13yacurqjgara.cloudfront.net/users/347241/screenshots/2749390/messenger-concept_teaser.gif", localshotimage_file_name: "open-uri20160601-38043-1n1y1xs", localshotimage_content_type: "image/gif", localshotimage_file_size: 7399047, localshotimage_updated_at: "2016-06-01 09:32:51"},
