  {title: "DESIGN DISRUPTORS coming to a city near you!", description: "<p>In 2015, we promised to produce the first ever feature length documentary about the thing we live and breathe: disruptive product design. On August 1, 2016, DESIGN DISRUPTORS drops‚Äîand even better, we are bringing it to a city near you on our international premiere tour. </p>\n\n<p>DESIGN DISRUPTORS started simply as conversations with design leaders we admired, but has evolved into a deep exploration and definition of the future of digital product design as a whole. </p>\n\n<p>Check out the film‚Äôs website, <a href=\"http://www.designdisruptors.com\" rel=\"noreferrer\">www.designdisruptors.com</a>, to join us for a premiere, check out new content, see behind the scenes footage and learn more about the film!</p>", width: "400", height: "300", tags: "[\"design\", \"film\", \"invision\", \"responsive\", \"ui\", \"website\"]", image_url: nil, image_path: nil, user_id: 79, viewcount: 3981, likes_count: 364, comments_count: 17, attachments_count: 0, rebounds_count: 0, buckets_count: 18, dribbble_id: 2749857, html_url: "https://dribbble.com/shots/2749857-DESIGN-DISRUPTORS-coming-to-a-city-near-you", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2749857/buckets", comments_url: "https://api.dribbble.com/v1/shots/2749857/comments", likes_url: "https://api.dribbble.com/v1/shots/2749857/likes", projects_url: "https://api.dribbble.com/v1/shots/2749857/projects", animated: false, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_url: nil, following_url: nil, shots_url: nil, teams_url: nil, team: nil, images_hidpi: "https://d13yacurqjgara.cloudfront.net/users/4988/screens