  {title: "Shipp app - Tracking", description: "<p>Have you ever shopped online? Did you remember the excitement when you can't wait the item you just purchased to come but the logistic services doesn't really explain where your item is?</p>\n\n<p>Tracking your item should be fun, with Shipp you can hold and easily manage your package on the fly, yet get a live update about your item.</p>\n\n<p>Key points on UX for the tracking part:\n<br />- Where is my item now? And what is the ETA?\n<br />- Quick history and live update when your item is departed from one point to another checkpoint.\n<br />- Adding a new track should be easy (interaction will be posted tomorrow)</p>\n\n<p>Full project : <a href=\"https://dribbble.com/buditanrim/projects/375567-Shipp\" rel=\"nofollow noreferrer\">Shipp </a>\n<br />________________________________________________\n<br /><a href=\"http://bit.ly/budiiG\" rel=\"nofollow noreferrer\"><strong>Instagram</strong></a> | <a href=\"https://twitter.com/buditanrim\" rel=\"nofollow noreferrer\"><strong>Twitter</strong></a> | <a href=\"http://budicon.buditanrim.co\" rel=\"nofollow noreferrer\"><strong>Budicon</strong></a> | <a href=\"http://chromaicon.com\" rel=\"nofollow noreferrer\"><strong>Chromaicon</strong></a></p>", width: "400", height: "300", tags: "[\"application\", \"ios\", \"iphone\", \"mobile\", \"ui\", \"ux\"]", image_url: nil, image_path: nil, user_id: 100, viewcount: 1810, likes_count: 113, comments_count: 8, attachments_count: 1, rebounds_count: 0, buckets_count: 9, dribbble_id: 2751837, html_url: "https://dribbble.com/shots/2751837-Shipp-app-Tracking", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2751837/buckets", comments_url: "https://api.dribbble.com/v1/shots/2751837/comments", likes_url: "https://api.dribbble.com/v1/shots/2751837/likes", projects_url: "https://api.dribbble.com/v1/shots/2751837/projects", animated: false, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_url: nil, following_url: nil, shots_url: nil, teams_url: nil, team: nil, images_hidpi: "https://d13yacurqjgara.cloudfront.net/users/44485/screenshots/2751837/shipp.jpg", images_normal: "https://d13yacurqjgara.cloudfront.net/users/44485/screenshots/2751837/shipp_1x.jpg", images_teaser: "https://d13yacurqjgara.cloudfront.net/users/44485/screenshots/2751837/shipp_teaser.jpg", localshotimage_file_name: "open-uri20160602-35157-8rs0ho", localshotimage_content_type: "image/jpeg", localshotimage_file_size: 77311, localshotimage_updated_at: "2016-06-02 13:31:42"},
  {title: "Introducing Bounce ", description: "<p>At <a href=\"https://3dro.ps\" rel=\"nofollow noreferrer\">3drops</a>, we often innovate around ideas for about a week until they become, what we like to call, ‚ÄúMinimum Lovable Products‚Äù. Bounce is a result of a ‚Äòcreative muscle exercise‚Äô <a href=\"https://dribbble.com/331730\">@3drops</a>.</p>\n\n<p>Read our case study on Medium:\n<br /><a href=\"https://medium.com/3drops/rethinking-the-flight-ticket-industry-4d3066491279#.gko9d32b1\" rel=\"nofollow noreferrer\">Rethinking the flight ticket industry. </a></p>\n\n<p>Follow us on <a href=\"https://twitter.com/3drops\" rel=\"nofollow noreferrer\">twitter</a> &amp; <a href=\"https://www.facebook.com/3drops.se\" rel=\"nofollow noreferrer\">Facebook</a> to learn more about how we work. ‚úåÔ∏è</p>", width: "400", height: "300", tags: "[\"mvp\", \"on-boarding\", \"travel\", \"ui\", \"ux\"]", image_url: nil, image_path: nil, user_id: 101, viewcount: 1704, likes_count: 111, comments_count: 8, attachments_count: 0, rebounds_count: 0, buckets_count: 11, dribbble_id: 2751995, html_url: "https://dribbble.com/shots/2751995-Introducing-Bounce", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2751995/buckets", comments_url: "https://api.dribbble.com/v1/shots/2751995/comments", likes_url: "https://api.dribbble.com/v1/shots/2751995/likes", projects_url: "https://api.dribbble.com/v1/shots/2751995/projects", animated: true, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_url: nil, following_url: nil, shots_url: nil, teams_url: nil, team: nil, images_hidpi: "https://d13yacurqjgara.cloudfront.net/users/2546/screenshots/2751995/bounce_onboarding.gif"