  {title: "Stitch - visual branding process", description: "<p>A look behind the curtain on our visual branding process for client Stitch. <strong>Never forget that design is messy, specifically in the beginning of the project.</strong> Make sure to get your artboard full of ideas (good and bad) before you begin polishing the best direction. Go wide and distill down from there. </p>\n\n<p>For more detail on our visual identity process read this...\n<br /><a href=\"https://madebysidecar.com/journal/crafting-a-great-branding-delivery\" rel=\"noreferrer\">https://madebysidecar.com/journal/crafting-a-great-branding-delivery</a></p>\n\n<p>Here is a motion piece to wet your palette...\n<br /><a href=\"https://dribbble.com/shots/2747842-Stitch-Data\" rel=\"noreferrer\">https://dribbble.com/shots/2747842-Stitch-Data</a></p>\n\n<p>More to come on this project! </p>\n\n<p>---</p>\n\n<p>Looking for a design partner? We would love to hear about your needs. Email us <a href=\"mailto:hello@focuslabllc.com\" rel=\"noreferrer\">hello@focuslabllc.com</a></p>\n\n<p><a href=\"http://focuslabllc.com/\" rel=\"nofollow noreferrer\">Our website</a> / <a href=\"https://www.instagram.com/focuslabllc/\" rel=\"nofollow noreferrer\">Instagram</a> / <a href=\"https://twitter.com/focuslabllc\" rel=\"nofollow noreferrer\">Twitter</a></p>", width: "400", height: "300", tags: "[\"brand design\", \"branding\", \"data\", \"focus lab\", \"ideation\", \"identity\", \"identity design\", \"process\", \"stitch\"]", image_url: nil, image_path: nil, user_id: 150, viewcount: 965, likes_count: 87, comments_count: 4, attachments_count: 0, rebounds_count: 0, buckets_count: 2, dribbble_id: 2757124, html_url: "https://dribbble.com/shots/2757124-Stitch-visual-branding-process", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2757124/buckets", comments_url: "https://api.dribbble.com/v1/shots/2757124/comments", likes_url: "https://api.dribbble.com/v1/shots/2757124/likes", projects_url: "https:/