  {title: "Indian Dreamcatcher ", description: "<p>Hi everyone!</p>\n\n<p>I have just brought  one more character.  This guys is another piece of practice over digital illustration. Meet an Indian who catches and enjoys dreams! How about  snoozing a bit to grab some colorful sensations of freedom and life ease? Press L to join!</p>\n\n<p><strong>Creating illustrations and doing other graphic design tasks here in <a href=\"http://tubikstudio.com\" rel=\"nofollow noreferrer\">Tubik Studio</a> all the team designers pay thorough attention to the smallest nuances to add not only catchy style and nature but also meaning and problem-solving potential to the work. If you are keen to follow the full path of creative process, welcome to <a href=\"http://tubikstudio.com/blog/\" rel=\"nofollow noreferrer\">Tubik Blog</a> where we share case studies on diverse design projects by studio designers. Have a great day!</strong></p>\n\n<p><a href=\"https://www.behance.net/Tubik\" rel=\"nofollow noreferrer\">Behance</a> | <a href=\"http://instagram.com/tubikstudio\" rel=\"nofollow noreferrer\">Instagram</a> | <a href=\"https://twitter.com/tubikstudio\" rel=\"nofollow noreferrer\">Twitter</a> | <a href=\"https://www.facebook.com/tubikstudio\" rel=\"nofollow noreferrer\">Facebook</a> | <a href=\"https://plus.google.com/+Tubikstudio\" rel=\"nofollow noreferrer\">Google+</a> | <a href=\"http://tubikstudio.com/\" rel=\"nofollow noreferrer\">Tubik</a></p>", width: "400", height: "300", tags: "[\"adobe\", \"art\", \"cartoon\", \"character\", \"colors\", \"illustration\", \"illustrator\", \"indian\", \"photoshop\", \"skull\", \"wacom\"]", image_url: nil, image_path: nil, user_id: 227, viewcount: 703, likes_count: 113, comments_count: 7, attachments_count: 0, rebounds_count: 0, buckets_count: 0, dribbble_id: 2764245, html_url: "https://dribbble.com/shots/2764245-Indian-Dreamcatcher", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2764245/buckets", comments_url: "https://